import Carousel from "react-bootstrap/Carousel";
import home_carousel_One from "./Assest/home_carousel_One.jpg";
import home_carousel_Two from "./Assest/home_carousel_Two.jpg";

const Landing = () => {
  return (
    <div className="container ">
      <div className="jumbotron mt-5 jumbotron-fluid">
        {/* <div className="col-sm-8 mx-auto"> */}
        <h1 className="text-center">WELCOME To Equip9</h1>

        {/* Carousel Start */}
        <Carousel className=" col-sm-8 mx-auto">
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={home_carousel_One}
              alt="First slide"
            />
            <Carousel.Caption>
              <h3>First slide label</h3>
              <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={home_carousel_Two}
              alt="Second slide"
            />

            <Carousel.Caption>
              <h3>Second slide label</h3>
              <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={home_carousel_One}
              alt="Third slide"
            />

            <Carousel.Caption>
              <h3>Third slide label</h3>
              <p>
                Praesent commodo cursus magna, vel scelerisque nisl consectetur.
              </p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
        {/* Carousel End */}
      </div>
      {/* </div> */}
    </div>
  );
};

export default Landing;
